    parameters:
    - id: HttpMethod
      type: System.String
      description: The name of the HTTP method. Can be one of GET, POST, PUT, PATCH, or DELETE.
    - id: AuthorizationRequirements
      type: System.String
      description: >-
        The requirements for authorizing the HTTP request.
            For all HTTP requests except POST, contains the name of the authorizable operation that is required to authorize the request.
            For POST requests will contain the name of the authorizable operation optionally followed by a RBAC role name (in this case,
            the two values must be separated by '|'.
